//this file is used to update user password and will redirected to page /user/password
import React from 'react'
import UserNav from '../../components/nav/UserNav'
import { useState } from 'react'

const Password = () => {
    const[pass,setpass]=useState('')
    const passwordUpdate=()=>{
        <form>
            <div className='col form-group' style={{margin:"0px 0px 0px 400px"}}>
                <label>Your Password</label>
                <input
                type="password"
                value={pass}
                className='form-control'
                onChange={(e)=>setpass(e.target.value)}
                ></input>
            </div>
        </form>

    }
    return (
        <div className='container-fluid'>
            <div className='row'>
                <div className='col-mid-2'>
                  <UserNav/>
                </div>
                <div className='container' style={{margin:"0px 0px 0px 400px"}}>
                    <h4 >Password Update</h4>
                    {passwordUpdate()}
                </div>
                
            </div>
        </div>
    )
}

export default Password
